  .then((res) => res.json())
  .then((data) => {
    setDrinksCards(data);
  })
  .catch((error) => {
    console.error("Ошибка при получении данных:", error);
  });


  const [DrinksCard, setDrinksCards] = React.useState([])
  const DrinksCards = Array.isArray(DrinksCard)
  ? DrinksCard.map((card) => <li key={card.id}>{card.name}</li>)
  : null;


  return (
    <div>
      {DrinksCards}
    </div>
  )
}

